import React from 'react';
import './App.css';
import { Box, Paper, Typography, TextField, Button, Container} from '@mui/material';

function App() {
  return (
    <Container sx={{
      width: "100%",
      height: "100vh",
      display: "flex",
      alignItems: "center",
      justifyContent: "center"
    }}>
      <Box sx={{
        display: "flex",
        flexDirection: "column",
        justifyContent: "space-between",
        width: "400px",
        height: "500px",
        border: "1px solid #ccc",
        padding: 2,
        borderRadius: 1,
      }}>
        <Paper 
          elevation={3}
          sx={{
            flex: 1,
            padding: 2,
            overflowY: "auto",
            marginBottom: 2,
          }}
        >
          <Typography variant="body1">Hi</Typography>
        </Paper>
        <Box sx={{ display: "flex", gap: 1 }}>
          <TextField 
            fullWidth
            variant="outlined"
            value={inputMessage}
            fullWidth
          variant="outlined"
          value={inputMessage}
          />
          <Button>Sent</Button>
        </Box>

      </Box>
    </Container>
  );
}

export default App;
